import React from "react";

function PolicyCompare({ policies }) {
  if (policies.length === 0) return null;

  return (
    <div>
      <h2>정책 비교</h2>
      <table border="1" cellPadding="8" style={{ width: "100%" }}>
        <thead>
          <tr>
            <th>정책명</th>
            <th>지원대상</th>
            <th>지원내용</th>
            <th>신청기간</th>
          </tr>
        </thead>
        <tbody>
          {policies.map((p) => (
            <tr key={p.id}>
              <td>{p.name}</td>
              <td>{p.target}</td>
              <td>{p.content}</td>
              <td>{p.period}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default PolicyCompare;
